import React from 'react';

class StorePicker extends React.Component {
    constructor(props) {
      super(props);
      // initialize state here
      this.state = {
        name: "erwin",
        title: "The Store Picker"
      }
    }
    render() {
      return (
        <div>
          <h1>{this.state.title}</h1>
        </div>
      );
    }
  };

export default StorePicker;
